import React, { useState, useRef, useEffect } from "react";
import "./Video.css";

function formatCount(count) {
  const n = Number(count);
  if (isNaN(n)) return "0";
  if (n >= 1_000_000) return (n / 1_000_000).toFixed(1) + "M";
  if (n >= 1_000) return (n / 1_000).toFixed(1) + "K";
  return n.toString();
}

function Video({ url, channel, description, likes = 0, dislikes = 0, comments = 0 }) {
  const [likeCount, setLikeCount] = useState(Number(likes));
  const [dislikeCount, setDislikeCount] = useState(Number(dislikes));
  const [isLiked, setIsLiked] = useState(false);
  const [isDisliked, setIsDisliked] = useState(false);

  const videoRef = useRef(null);

  // Автовоспроизведение при попадании в зону видимости
  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        const video = videoRef.current;
        if (video) {
          if (entry.isIntersecting) {
            video.play().catch(() => {});
          } else {
            video.pause();
          }
        }
      },
      {
        threshold: 0.75,
      }
    );

    if (videoRef.current) observer.observe(videoRef.current);

    return () => {
      if (videoRef.current) observer.unobserve(videoRef.current);
    };
  }, []);

  const onLike = () => {
    if (isLiked) {
      setLikeCount(prev => prev - 1);
      setIsLiked(false);
    } else {
      setLikeCount(prev => prev + 1);
      setIsLiked(true);
      if (isDisliked) {
        setDislikeCount(prev => prev - 1);
        setIsDisliked(false);
      }
    }
  };

  const onDislike = () => {
    if (isDisliked) {
      setDislikeCount(prev => prev - 1);
      setIsDisliked(false);
    } else {
      setDislikeCount(prev => prev + 1);
      setIsDisliked(true);
      if (isLiked) {
        setLikeCount(prev => prev - 1);
        setIsLiked(false);
      }
    }
  };

  const onComment = () => {
    alert("Открытие комментариев — в разработке");
  };

  const onShare = () => {
    navigator.clipboard.writeText(window.location.href + url);
    alert("Ссылка скопирована!");
  };

  return (
    <div className="video">
      <video
        ref={videoRef}
        className="video__player"
        src={url}
        loop
        playsInline
        controls
      />

      <div className="video__sidebar">
        <div className={`video__button ${isLiked ? "active" : ""}`} onClick={onLike}>
          <img src="/icons/like.svg" alt="Like" />
          <span>{formatCount(likeCount)}</span>
        </div>
        <div className={`video__button ${isDisliked ? "active" : ""}`} onClick={onDislike}>
          <img src="/icons/dislike.svg" alt="Dislike" />
          <span>{formatCount(dislikeCount)}</span>
        </div>
        <div className="video__button" onClick={onComment}>
          <img src="/icons/comment.svg" alt="Comment" />
          <span>{formatCount(comments)}</span>
        </div>
        <div className="video__button" onClick={onShare}>
          <img src="/icons/share.svg" alt="Share" />
        </div>
      </div>

      <div className="video__footer">
        <div className="video__channel">
          <p>@{channel}</p>
          <button>Подписаться</button>
        </div>
        <div className="video__description">{description}</div>
      </div>
    </div>
  );
}

export default Video;
